import { useState } from "react";
import axios from "axios";
const NewIntern = () => {
    const [companyName,setCompanyName] = useState("");
    const [jobRole,setJobRole] = useState("");
    const [stipend,setStipend] = useState("");
    const [cutoff,setCutoff] = useState("");
    
    const addToList = async(req,res) =>{
        console.log("button working!!")
         await axios.post("http://localhost:3001/insert",{
            companyName: companyName,
            jobRole: jobRole,
            stipend: stipend,
            cutoff: cutoff
        });
    }

    console.log("New intern is accessed!")
    return (
        <div className="details">
            {/* <form> */}
                <div>
                    <label>Company Name</label>
                    <input type="text" id="CompanyName" onChange={(e)=>{
                        setCompanyName(e.target.value);
                    }}/>
                </div>
                <div>
                    <label>Job Role</label>
                    <input type="text" id="JobRole" onChange={(e)=>{
                        setJobRole(e.target.value);
                    }}/> 
                </div>
                <div>
                    <label>Stipend</label>
                    <input type="text" id="Stipend" onChange={(e)=>{
                        setStipend(e.target.value);
                    }}/> 
                </div>
                <div>
                    <label>Cut-Off</label>
                    <input type="text" id="Cutoff" onChange={(e)=>{
                        setCutoff(e.target.value);
                    }}/> 
                </div>
                <button onClick={addToList}>Submit</button>
            {/* </form> */}
        </div>
    );
}

export default NewIntern;
